  useEffect(() => {
    progressInterval = setInterval(() => {
      setProgress(prev => prev + 1);
    }, 1000);
  }, []);

 
    return (
      <div className="body">
        <div className="row d-flex justify-content-center">
        <div className="col-8 myProg">
        {progress<100 && <ProgressBar className="gg" now={progress} label={`${progress}%`}/>}
      </div>
      </div>
      </div>
      
      
    );
  }
  
